import React from 'react';
import { FaSlidersH } from 'react-icons/fa';
import './CategoryButtons.css'; // Custom CSS for the swipe/scroll behavior

const CategoryButtons = ({ onCategorySelect }) => {
  const categories = ["Flower", "Pre-rolls", "Vape", "Edibles", "Concentrates", "Accessories"];

  return (
    <div className="category-buttons-container">
       <FaSlidersH className="me-3" size={20} />
      <div className="btn-group">
        {categories.map((category, index) => (
          <button
            key={index}
            className="btn btn-outline-secondary"
            onClick={() => onCategorySelect(category)}
          >
            {category}
          </button>
        ))}
      </div>

    </div>
  );
};

export default CategoryButtons;
